import React, {useState} from 'react'
import {ImageSlider} from './ServiceImg'

export const Images = () => {
    const [current, setCurrent] = useState(0)
    
    return (
        <div>
           {ImageSlider.map((slide, index) => {
               return <img src={slide.image} alt='image' />
           })}
        </div>
    )
}
